import Repository, { apiUrl } from './Repository';

class AuthRepository {
    constructor(callback) {
        this.callback = callback;
    }
    async getActiveExams(payload) {
        const reponse = await Repository.get(`${apiUrl}/examinationCalendar/sub?_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async getInactiveExams(payload) {
        const reponse = await Repository.get(`${apiUrl}/location/state/Y?_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async getActiveMain(payload) {
        const reponse = await Repository.get(`${apiUrl}/examinationCalendar/sub?_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async getInactiveMain(payload) {
        const reponse = await Repository.get(`${apiUrl}/location/state/sub?_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
}

export default new AuthRepository();
